import Axios from "axios";
import axios from "axios";



export const addCar = (backlog_id, car, history) => async dispatch => {

  await axios.post(`/api/backlog/${backlog_id}`, car);
  history.push(`/clientBoard/${backlog_id}`);
  
    

};
